    "invasive-plant-species-and-area-prioritization-report-kern-national-wildlife-refuge",nt"isopen":
    false,nt"url": null,nt"notes": "On August 4-5, 2015 a workshop was held
    at the Kern National Wildlife Refuge (NWR) headquarters to prioritize species and
    area targets for inventory. Participants at the workshop included: Heather Olsen
    (Research Technician, Utah State University), Corey Ransom (Professor and PI, Utah
    State University), and Nick Stanley (Project Leader, Kern NWR Complex). Earlier
    in 2015, the Kern NWR received a grant to conduct an invasive species inventory
    on refuge lands. The purpose of the workshop was to prioritize invasive species
    and management area targets for inventory. The results of the prioritization will
    be used to help direct inventory objectives and inventory method selection. The
    inventory will be conducted in late 2015 or early 2016.",nt"license_title":
